import React from 'react';


const MenuItem = ({ item }) => (
  <div style={{ marginBottom: '10px', borderBottom: '1px solid #ccc' }}>
    <h3>{item.name} - ${item.price}</h3>
    <p>{item.description}</p>
  </div>
);

export default MenuItem;
